#some features are generally not handled very well by standard ML models in their raw form.
#In particular, cyclical features (month, day) and geospatial features (longitude, latitude)
#need to be encoded using a cosine/sine transform, in order to avoid singularities at the end points.
#E.g., August 31st and September 1st are very close in time, yet one is DAY == 31 and the other DAY == 1
#Same if you had an hour feature: 23:59 and 0:01. Those are 2 minutes away yet with a large difference.
