"""![cyclical.jpeg](data:image/jpeg;base64,)

Let's encode latitude and longitude with cos/sin.
"""

#Let's do it!

latitude_features = ['LATITUDE_'+str(i) for i in range(7)]

for lat_feature in latitude_features:
    tropical_cyclones['COS_'+lat_feature] = np.cos(2*np.pi*tropical_cyclones[lat_feature]/90)
    tropical_cyclones['SIN_'+lat_feature] = np.sin(2*np.pi*tropical_cyclones[lat_feature]/90)


# Your turn! Do the same encoding for the longitude feature. Be careful to the range of the longitude ;)

# If this is way too easy for you, encode the date into cos/sin as well, which is slightly more involved.
# Requirement: MONTH = August, DAY = 30, corresponds to day 242. We want the encoding of the day number!

# TODO: Do the same encoding for the longitude feature.

#@title Answer

longitude_features = ['LONGITUDE_'+str(i) for i in range(7)]

for lon_feature in longitude_features:
    tropical_cyclones['COS_'+lon_feature] = np.cos(2*np.pi*tropical_cyclones[lon_feature]/180)
    tropical_cyclones['SIN_'+lon_feature] = np.sin(2*np.pi*tropical_cyclones[lon_feature]/180)

"""Let's now convert the date into cos/sin. This is more involved because we have to deal with datetimes. There are many ways to do this. I propose a "pythonic" solution."""

#@title Answer

from datetime import datetime, date

def get_day(year,
            month,
            day):
    d = date(int(year), int(month), int(day)) #create a datetime out of the different values
    day_number = d.timetuple().tm_yday #get the day number
    return np.cos(2*np.pi*day_number/365), np.sin(2*np.pi*day_number/365) #return cos/sin

tropical_cyclones['COS_DATE'], tropical_cyclones['SIN_DATE'] = zip(*tropical_cyclones.apply(lambda x: get_day(x.YEAR_0, x.MONTH_0, x.DAY_0), axis=1)) #the zip function unpacks the tuple

